VALUES(176001, 240111044331048623, '金融基地', '金融基地', 195506, '13632650699', '深圳市南山区科技园科苑路6号', NULL, 113.953143,22.549789, 'ws103144h9mf', '科技园金融基地一期总建筑面积9.6万平方米，项目分A、B两栋，每栋12层，1-3层为商业裙楼，约14000平方米，4-12层为办公场所。科技园金融基地一期写字楼荣获深圳首家国际绿色建筑LEEDTM认证金奖，独享双花园广场景观，南面为3000平米外花园广场，拥有面积达5000平米的围合式中央花园。尤为值得一提的是在基地建设运营中，科技园金融基地与世界著名的物业顾问公司——世邦魏理仕全方位合作，全方位提升物业管理水平。', 'cs://1/image/aW1hZ2UvTVRveE5tVXdPVEUzWWpFMk1qUTBZbVV4TVRGaE5UazROemMyTkRCaE4yVTNNUQ', 2, 1, NULL, 1, '2015-11-05 14:56:31', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
VALUES(176122, 240111044331048623, '金融科技大厦', '金融科技', 195506, '13632650699', '南山区高新中区科苑大道16号', NULL, 113.95097,22.552217, 'ws1031884jcw', '金融科技园大厦位于科技园中区，比邻腾讯，近地铁罗宝线（深大A4)，楼盘总高26层，楼盘外观形象大气，内部设施完善，交通便利。周边配套成熟，有餐饮、银行、便利店、咖啡厅等。', 'cs://1/image/aW1hZ2UvTVRvd1pEaGhZVGxoTVRZek5tVTVZbUkwWlRVd05USmtOREZoWlRBd056RTJNUQ', 2, 1, NULL, 1, '2015-11-05 14:56:31', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
VALUES(176125, 240111044331048623, '科技工业园大厦', '科技园', 195506, '13632650699', '深圳市南山区科技园科苑路6号', NULL,113.952909,22.549597, 'ws10348q7fzn', '深圳科技工业园是我国大陆第一个高新科技产业园，于1985年由深圳市政府和中国科学院共同创办。1991年，经国务院批准，深圳科技工业园成为首批国家级高新技术产业园区。科技工业大厦于1997年投入使用，是深圳科技工业园片区较早投入使用的高端写字楼。科技工业大厦自投入使用以来，先后引进和扶持多家知名高新技术企业，其中包括联想集团、华为等国内外知名企业。
科技工业大厦位于深圳市南山区科苑路6号，地处深圳高新中区核心位置，紧邻深南大道、北环大道和地铁一号线，临近的科园大道与深港西部通道直接相连，可瞬间通达香港、宝安机场、蛇口港、广深高速公路等，交通便利。
现入驻有福瑞博德、网宿科技、H3C等共计47家高新技术企业。', 'cs://1/image/aW1hZ2UvTVRwaU9EYzFNVGs0WXpoalpERmpZMkkyTWpJNE5EZGpOVFU1T1dSbFpHTmlNZw', 2, 1, NULL, 1, '2015-11-05 14:56:31', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
VALUES(176121, 240111044331048623, '生产力大楼', '生产力大楼', 195506, '13632650699', '广东省深圳市高新中二道5号', NULL, 113.949644,22.551566, 'ws103129pxt6', '生产力大厦位于南山科技园中区，科苑路与高新中二道交汇处，深南大道旁，步行至深大地铁口仅需3分-钟，周边写字楼有科兴科学园、金融科技大厦、深圳软件园、比克大厦、研祥科技大厦等甲级写字楼。园区内有百度，嗒嗒巴士等知名企业。', 'cs://1/image/aW1hZ2UvTVRvd016UXdaR00zTmpSbU5HWmtNakZqWkRGa01qTmlPVEkyTnpBNU1tWTJOdw', 2, 1, NULL, 1, '2015-11-05 14:56:31', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);


